import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { Button } from "@material-ui/core";
//import carrierCodeReducer from "../reducers/carrierCodeReducer"
import udpdateCarrierCode from "../actions/udpdateCarrierCode";

import { connect } from "react-redux";
class CardDefine extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      carrierCode: this.props.carrierCode
    };
  }
  handleState = () => {
    this.props.handleState(this.state.carrierCode);
    console.log(this.props);
  };
  render() {
    console.log(this.props);
    return (
      <div>
        <Button
          style={{
            width: 200,
            margin: 25,
            fontFamily: "'Roboto",
            backgroundColor: "#CCCCCC",
            color: "#1C80B5",
            textAlign: "center"
          }}
          onClick={this.handleState}
        >
          <h1>{this.state.carrierCode}</h1>
        </Button>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return state;
};
const mapActionToProps = {
  handleState: udpdateCarrierCode
};
export default connect(
  mapStateToProps,
  mapActionToProps
)(CardDefine);
